  - id: 107
    name: Targeted Studies Recruitment - Q1 Completers
    description: "Q1 Completers that have not completed either the Brain Health or
      Personal Network Studies.\r\n\r\nExcludes inactive players (not 11 or 12) and
      Study Opt-Outs.\r\n"
    sql: "select masters.msid, first_name, last_name, data, pi.source, \r\nCASE \tWHEN
      EXISTS(SELECT * FROM ml_app.tracker_history th WHERE masters.id = th.master_id
      AND sub_process_id = 79)\r\n\t\tTHEN NULL\r\n\tWHEN EXISTS (SELECT * FROM ml_app.bhs_complete_full
      WHERE masters.id = bhs_complete_full.master_id)\r\n\t\tTHEN 'complete'\r\n\tELSE
      'https://testmybrain.org/fphs/get_id.php'||chr(63)||'id='||bhs_assignments.bhs_id\r\nEND
      as BHS_link, \r\nCASE\tWHEN EXISTS(SELECT * FROM ml_app.tracker_history th WHERE
      masters.id = th.master_id AND sub_process_id = 100)\r\n\t\tTHEN NULL\r\n\tWHEN
      EXISTS (SELECT * FROM ml_app.persnet_complete WHERE persnet_complete.master_id
      = masters.id)\r\n\t\tTHEN 'complete'\r\n\tELSE persnet_links.link\r\nEND AS
      PersNet_link\r\nFROM ml_app.masters\r\nJOIN ml_app.player_infos pi ON masters.id
      = pi.master_id AND pi.rank IN (11,12)\r\nJOIN ml_app.player_contacts pc ON masters.id
      = pc.master_id AND pc.rank = 10 AND pc.rec_type = 'email'\r\nJOIN ml_app.bhs_assignments
      ON bhs_assignments.master_id = masters.id\r\nJOIN ml_app.persnet_links ON persnet_links.master_id
      = masters.id\r\nFULL JOIN ml_app.persnet_complete ON persnet_complete.master_id
      = masters.id\r\nWHERE EXISTS (SELECT * FROM (SELECT msid FROM q1.sc_stage UNION
      SELECT redcap_survey_identifier FROM q1.rc_stage) a WHERE masters.msid = a.msid)\r\nAND
      (\t\r\n\tNOT EXISTS (\tSELECT * FROM ml_app.bhs_complete_full WHERE bhs_complete_full.master_id
      = masters.id)\r\n\tOR \r\n\tpersnet_complete.master_id IS NULL\r\n)\r\nAND NOT
      EXISTS (SELECT * FROM ml_app.tracker_history th WHERE th.master_id = masters.id
      AND sub_process_id = 54)\r\norder by msid"
